import React from 'react';

export default function Buttoni({ first, buttons, onClickHandler }) {
    return (
        <div className="bot">
            <p>{first}</p>
            {buttons.map((btnText, index) => (
                <button key={index} className="button" onClick={() => onClickHandler(btnText)}>
                    {btnText}
                </button>
            ))}
        </div>
    );
}
